import React from "react";

const SideBar = () => {
  return (
    <div class="side_bar">
      <form>
        <label>
          Name:
          <input type="text" name="name" />
        </label>
        <input type="submit" value="Submit" />
      </form>
    </div>
  );
};
export default SideBar;
